const Display = ({ countryList }) => {
  if (countryList.length === null) {
    return null
  }
  else if (countryList.length > 10) {
    return (
      <div>
        Too many matches, specify another filter
      </div>
    )
  }
  else if (countryList.length <= 10) {
    return (
      countryList.map(country => <div>{country.name.common}</div>)
    )
  }
  return (
    null
  )
}

export default Display
